import './App.css';
import React from 'react';
import { BrowserRouter, Router, Route } from 'react-router-dom';
import Home from './components/Home';
const App = () => {
  return (
    <React.Fragment>
      <BrowserRouter>
        <Router>
          <Route path="/" element={<Home />} />
        </Router>
      </BrowserRouter>
    </React.Fragment>
  );
};

export default App;
